import React, { Component } from 'react';
import Physics from './physics.js';
import Home from './home.js';
import StartStream from './startstream.js';
import Stream from './stream.js';
import Header from './header.js';
import { Switch, Route } from 'react-router-dom';
import SignUp from './signup.js';
import Profile from './profile.js';
import WaitingRoom from './waitingroom.js';
import Navbar from './navbar.js';
import StreamingPlaza from './streamingplaza.js';
import Settings from './settings.js';
import LogIn from './login.js';
import { auth } from 'firebase';

import { connect } from 'react-redux';

class Main extends Component {
  render() {
    const HomePage = () => {
      return <Home />;
    };


    const WaitingRoomPage = () => {
      return <WaitingRoom />;
    };

    const ProfilePage = () => {
      return <Profile />;
    };

    const StreamingPlazaPage = () => {
      return <StreamingPlaza />;
    };

    const SettingsPage = () => {
      return <Settings />;
    }

    const LogInPage = () => {
      return <LogIn />;
    }

    const { auth, profile } = this.props;

    return (
      <div>
        <Switch>
          <Route exact path='/' component={Home} />
          <Route path='/home' component={Home} />
          <Route path='/profile' component={Profile} />
          <Route path='/waitingroom' component={WaitingRoom} />
          <Route path='/streamingplaza' component={StreamingPlaza} />
        </Switch>
      </div>
    );
  }
}

//{ auth.uid ? <Route path={profile.profile_url} component={ProfilePage} /> : null }

const mapStateToProps = (state) => {
  return {
    auth: state.firebase.auth,
    profile: state.firebase.profile
  }
}

export default connect(
  mapStateToProps
)(Main);
